  false,\n\t\"url\": null,\n\t\"notes\": \"Little information has been produced since
  the mid 1970s about the roundscale spearfish Tetrapturus georgii (Lowe, 1840). The
  most complete species description was based on examination of four individuals from
  the eastern Atlantic. On the basis of detailed laboratory examination of 16 specimens,
  as well as fishery observer information and biological samples from an additional
  49 individual specimens, we update morphological descriptions and key identification
  characteristics of this species for the western North Atlantic. Key characters include
  lateral scale morphology and position of the anal opening the scales having rounded
  and broad anterior bases with usually multiple posterior points, and the anal opening
  located a distance between 0.48 and 0.81 the height of the first anal fin.\",\n\t\"license_title\":
